  return (

  <>  

    <main className="">
      <h1>Home</h1>

    <div className='card-grid'>
    { dentists.map(dentist => (
  <div key={dentist.id}>
    <Link to={'/dentist/'+ dentist.name}><h4>{dentist.name}</h4></Link>
    <Card dentist={dentist} />
  </div>
))}
        

    </div>

    </main>

    </>
  )
}
export default Home
